def drawCircle(cent,r):
  print("cent",cent)
  x = np.arange(cent[0]-r, cent[1]+r, 0.01)
  y = cent[1] + np.sqrt(r**2 - (x - cent[0])**2)
  # print(y)
  plt.plot(x,y,color='r',linestyle='-')
  plt.plot(x,-y+2*cent[1],color='r',linestyle='-', linewidth=1)
  plt.scatter(cent[0],cent[1],c='b',marker='o') # 5

# 经纬度转坐标
def transform(x0,y0,a0,b0):
    l = 144.5109
    r = 150.0215
    t = -35.4608
    b = -38.0619
    x = (r - l) / a0 # 经度
    y = (t - b) / b0 # 纬度
    x1 = (x0 - l) / x
    y1 = - (y0 - t) / y
    return x1, y1 # 经度，纬度

