# 计算火灾威力矩阵
def fill_fire_power(cent,i,fire_power,num,shape):
    leftbound = cent[1]-i # 左边界
    rightbound = cent[1]+i # 右边界
    topbound = cent[0]-i # 上边界
    bottombound = cent[0]+i # 下边界
    # print(shape[0])
    leftbound = leftbound if leftbound > 0 else 0 # 左边不能小于0
    rightbound = rightbound if rightbound < shape[1] - 1 else shape[1] - 1 # 右边不能大于cells.shape[1]
    topbound = topbound if topbound > 0 else 0 # 上边不能小于0
    bottombound = bottombound if bottombound < shape[0] - 1 else shape[0] - 1 # 下边不能大于cells.shape[0]
    # for i1 in range(topbound, bottombound-1):
    # for j1 in range(leftbound, rightbound-1):
    left = fire_power[topbound:bottombound+1,leftbound]
    fire_power_bool = num > left
    left[fire_power_bool] = num # 左
    fire_power[topbound:bottombound+1,leftbound] = left
    # print("fire_power_bool",fire_power_bool)
    # print("left",left)
    # print("fire_power[topbound:bottombound+1,leftbound]",fire_power[topbound:bottombound+1,leftbound])
    # print("fire_power",fire_power)
    right = fire_power[topbound:bottombound+1,rightbound]
    fire_power_bool = num > right
    right[fire_power_bool] = num # 右
    fire_power[topbound:bottombound+1,rightbound] = right
    top = fire_power[topbound,leftbound:rightbound+1]
    fire_power_bool = num > top
    top[fire_power_bool] = num # 上
    fire_power[topbound,leftbound:rightbound+1] = top
    bottom = fire_power[bottombound,leftbound:rightbound+1]
    fire_power_bool = num > bottom
    bottom[fire_power_bool] = num # 下
    fire_power[bottombound,leftbound:rightbound+1] = bottom

#pca特征维度压缩函数
#@dataMat 数据集矩阵
#@topNfeat 需要保留的特征维度，即要压缩成的维度数，默认4096
def pca(dataMat,topNfeat=4096):
    #求数据矩阵每一列的均值
    meanVals=np.mean(dataMat,axis=0)
    print("meanVals",meanVals)
    #数据矩阵每一列特征减去该列的特征均值
    meanRemoved=dataMat-meanVals
    print("meanRemoved",meanRemoved)
    #计算协方差矩阵，除数n-1是为了得到协方差的无偏估计
    #cov(X,0) = cov(X) 除数是n-1(n为样本个数)
    #cov(X,1) 除数是n
    conMat=np.cov(meanRemoved,rowvar=0)
    print("conMat",conMat)
    #计算协方差矩阵的特征值及对应的特征向量
    #均保存在相应的矩阵中
    eigVals,eigVects=np.linalg.eig(np.mat(conMat))
    print("eigVals",eigVals)
    print("eigVals[3]",eigVals[3])
    #sort():对特征值矩阵排序(由小到大)
    #argsort():对特征值矩阵进行由小到大排序，返回对应排序后的索引
    eigValInd=np.argsort(eigVals)
    print("eigValInd",eigValInd)
    #从排序后的矩阵最后一个开始自下而上选取最大的N个特征值，返回其对应的索引
    topNfeat = 0
    for i in range(len(eigValInd)-1, -1, -1):
      # print("eigValInd[i]",eigValInd[i])
      if abs(eigVals[eigValInd[i]]) > 1e-3:
        topNfeat = topNfeat + 1
    print("topNfeat",topNfeat)
    eigValInd=eigValInd[:-(topNfeat+1):-1]
    print("eigValInd",eigValInd)
    #将特征值最大的N个特征值对应索引的特征向量提取出来，组成压缩矩阵
    redEigVects=eigVects[:,eigValInd]
    #将去除均值后的数据矩阵*压缩矩阵，转换到新的空间，使维度降低为N
    lowDDataMat=meanRemoved*redEigVects
    #利用降维后的矩阵反构出原数据矩阵(用作测试，可跟未压缩的原矩阵比对)
    reconMat=(lowDDataMat*redEigVects.T)+meanVals
    #返回压缩后的数据矩阵即该矩阵反构出原始数据矩阵
    return lowDDataMat,reconMat

