"""# PCA"""

##Python实现PCA
import numpy as np

cap=[3.5,8,14,11,15,22,20]
speed=[40,79,64,60,60,79,64]
time=[35,40,35,18,15,24,16]

#pca特征维度压缩函数
#@dataMat 数据集矩阵
#@topNfeat 需要保留的特征维度，即要压缩成的维度数，默认4096
def pca(dataMat,topNfeat=4096):
    #求数据矩阵每一列的均值
    meanVals=np.mean(dataMat,axis=0)
    #数据矩阵每一列特征减去该列的特征均值
    meanRemoved=dataMat-meanVals
    #计算协方差矩阵，除数n-1是为了得到协方差的无偏估计
    #cov(X,0) = cov(X) 除数是n-1(n为样本个数)
    #cov(X,1) 除数是n
    conMat=np.cov(meanRemoved,rowvar=0)
    #计算协方差矩阵的特征值及对应的特征向量
    #均保存在相应的矩阵中
    eigVals,eigVects=np.linalg.eig(np.mat(conMat))
    print("eigVals",eigVals)
    #sort():对特征值矩阵排序(由小到大)
    #argsort():对特征值矩阵进行由小到大排序，返回对应排序后的索引
    eigValInd=np.argsort(eigVals)
    #从排序后的矩阵最后一个开始自下而上选取最大的N个特征值，返回其对应的索引
    eigValInd=eigValInd[:-(topNfeat+1):-1]
    print("eigValInd",eigValInd)
    #将特征值最大的N个特征值对应索引的特征向量提取出来，组成压缩矩阵
    redEigVects=eigVects[:,eigValInd]
    #将去除均值后的数据矩阵*压缩矩阵，转换到新的空间，使维度降低为N
    lowDDataMat=meanRemoved*redEigVects
    #利用降维后的矩阵反构出原数据矩阵(用作测试，可跟未压缩的原矩阵比对)
    reconMat=(lowDDataMat*redEigVects.T)+meanVals
    #返回压缩后的数据矩阵即该矩阵反构出原始数据矩阵
    return lowDDataMat,reconMat

# X = np.array([[-1, 1], [-2, -1], [-3, -2], [1, 1], [2, 1], [3, 2]])

X=np.array([
    [cap[0], speed[0], time[0], time[0], time[0], time[0]],
    [cap[1], speed[1], time[1], time[1], time[1], time[1]],
    [cap[2], speed[2], time[2], time[2], time[2], time[2]],
    [cap[3], speed[3], time[3], time[3], time[3], time[3]],
    [cap[4], speed[4], time[4], time[4], time[4], time[4]],
    [cap[5], speed[5], time[5], time[5], time[5], time[5]],
    [cap[6], speed[6], time[6], time[6], time[6], time[6]],
])
print(X)
lowDDataMat,reconMat = pca(X, 1)
print("lowDDataMat",lowDDataMat)
print("reconMat",reconMat)

