def transform(x0,y0,a0,b0):
    l = 144.5109
    r = 150.0215
    t = -35.4608
    b = -38.0619
    x = (r - l) / a0 # 经度
    y = (t - b) / b0 # 纬度
    x1 = (x0 - l) / x
    y1 = - (y0 - t) / y
    return x1, y1 # 经度，纬度
